import React from "react";
import Panel from "./panel";

const Dashboard = () => {
  return (
    <div className="dshbrd-1">
      <Panel
        w="5"
        h="3"
        classes={["convex"]}
        style={{
          container: { flex: "0 0 30%", padding: "10px", height: "300px" },
        }}
      ></Panel>
      <Panel classes={["flx-clmn"]} style={{ container: { flex: "0 0 30%" } }}>
        <Panel
          classes={["convex"]}
          style={{ container: { flex: "0 0 30%", padding: "10px" } }}
        ></Panel>
        <Panel
          classes={["concave"]}
          style={{ container: { flex: "0 0 70%", padding: "10px" } }}
        ></Panel>
      </Panel>
      <Panel style={{ container: { flex: "0, 0, 40%" } }}>
        <Panel w="6.6" row={false}>
          <Panel w="6"></Panel>
          <Panel w="6"></Panel>
          <Panel w="8" convex={true}></Panel>
        </Panel>
        <Panel w="6.6" row={false}>
          <Panel w="8" convex={true}></Panel>
          <Panel w="6"></Panel>
          <Panel w="6"></Panel>
        </Panel>
        <Panel w="6.6" row={false}>
          <Panel w="6"></Panel>
          <Panel w="8" convex={true}></Panel>
          <Panel w="6"></Panel>
        </Panel>
      </Panel>
      <Panel w="10" h="3" concave={true}></Panel>
      <Panel w="10" h="3" convex={true}></Panel>
    </div>
  );
};

export default Dashboard;
